import React from 'react';

function Logo() {
    return (
        <img src={`${process.env.PUBLIC_URL}/final_logo.png`} alt="Logo" className="h-24 sm:h-32 md:h-40 w-auto absolute top-0 left-0 mt-6 sm:mt-8 md:mt-16 ml-6 sm:ml-8 md:ml-16" />
    );
}

export default Logo;
